import ListItem from "./list-item";

const TodoList = () => {

    const items = ['покушать','выспаться'];
    return (
        <ul>
            <li>{items[0] }</li>
            <li>{items[1] }</li>
            <li><TodoList /></li>
        </ul>
    );
}

export default TodoList;
